import React from 'react'

function Home() {
    return (
        <div>
          <h2>About App </h2>
          <p>User will able to add and edit items to the inventory.</p>
          <p>Inventory will be updated after the sales.</p>
          <p></p>
        </div>
    )
}

export default Home
